import {BrowserRouter, Routes ,Route} from 'react-router-dom'
import CandidateRegistration from './components/CandidateRegistration';




function App() {
  return (
    <div>

      <BrowserRouter>
      <Routes>
        <Route path='/' element={<CandidateRegistration/>}/>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
